import React from 'react';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faEdit, faTrash } from '@fortawesome/free-solid-svg-icons';
import './ProgramTypes.css';

function ProgramTypes() {
  return (
    <div className="program-types-screen">
      <button className="add-new-button">+ Add New</button>
      <table className="content-table">
        <thead>
          <tr>
            <th>Type of Content</th>
            <th>Description</th>
            <th>Action</th>
          </tr>
        </thead>
        <tbody>
          {[...Array(10)].map((_, index) => (
            <tr key={index}>
              <td>IAP</td>
              <td>Investor awareness programme content document</td>
              <td>
                <button className="edit-button">
                  <FontAwesomeIcon icon={faEdit} />
                </button>
                <button className="delete-button">
                  <FontAwesomeIcon icon={faTrash} />
                </button>
              </td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
}

export default ProgramTypes;
